import streamlit as st
import pandas as pd
from rdkit import Chem
from rdkit.Chem import AllChem
import time
import joblib
from io import BytesIO
import base64
import os
import numpy as np
from rdkit import DataStructs
import base64, joblib
from io import BytesIO

def load_model_from_string(base64_string):
    model_bytes = base64.b64decode(base64_string)
    model_buffer = BytesIO(model_bytes)
    return joblib.load(model_buffer)

# ---------------- MODEL CONFIGS ----------------
MODELS = {
    "A": {
        "name": "Sensitive",
        "radius": 2,
        "output": "Sensitive_predictions.csv",
        "string": ""
    },
    "B": {
        "name": "Precise",
        "radius": 3,
        "output": "Precise_predictions.csv",
        "string": ""
    },
    "C": {
        "name": "Balanced",
        "radius": 2,
        "output": "Balanced_predictions.csv",
        "string": "" 
    }
}

config = MODELS[choice]
model = load_model_from_string(config["string"])

# ---------------- USER CHOICE ----------------
st.subheader("Select the prediction model")

choice = st.radio(
    label="Prediction Model",
    options=["A", "B", "C"],
    format_func=lambda x: {
        "A": "Sensitive Predictor (minimizes overlooking potentially effective hits, ideal for early-stage virtual screening)",
        "B": "Precise Predictor (more confident in positive-predicted hits, ideal for streamlining virtual screening)",
        "C": "Balanced Predictor (balances sensitivity and specificity)"
    }[x]
)

# ---------------- DATA LOADING ----------------
uploaded_file = st.file_uploader("Upload your CSV file", type=["csv"])
if uploaded_file is not None:
    df = pd.read_csv(uploaded_file)

    st.write("Columns in your file:", list(df.columns))

    smiles_column = st.selectbox("Select the SMILES column", df.columns)
    id_column = st.selectbox("Select the ID column", df.columns)

    st.success(f"SMILES column: {smiles_column}, ID column: {id_column}")


# ---------------- FEATURE GENERATION ----------------
fps, ids, smiles_list = [], [], []

for _, row in df.iterrows():
    smi = row[smiles_column]
    mol = Chem.MolFromSmiles(smi)
    if mol is not None:
        fp = AllChem.GetMorganFingerprintAsBitVect(mol, config["radius"], nBits=128)
        arr = np.zeros((1,))
        DataStructs.ConvertToNumpyArray(fp, arr)
        fps.append(arr)
        ids.append(row[id_column])
        smiles_list.append(smi)

X_predict = np.array(fps)

# ---------------- PREDICTION ----------------
predicted_classes = model.predict(X_predict)

output_df = pd.DataFrame({
    smiles_column: smiles_list,
    id_column: ids,
    "Class": predicted_classes
})




